import {
    UilChartPieAlt,
    UilShoppingCart,
    UilPricetagAlt,
    UilUsersAlt,
    UilUsdSquare,
    UilCommentAltHeart,
    UilUserSquare
} from "@iconscout/react-unicons"

// Sidebar Data
export const SidebarData = [
    {
      icon: UilChartPieAlt
    },
    {
      icon: UilShoppingCart
    },
    {
      icon: UilPricetagAlt
    },
    {
      icon: UilUsersAlt
    }
];

export const cardsData = [
  {
    title: "Revenue",
    color: {
      backGround: "linear-gradient(rgb(31, 29, 43) .42%, (31, 29, 43) -46.42%)"
    },
    barValue: 70,
    value: "IDR25,000,970",
    png: UilUsdSquare,
    series: [
      {
        name: "Sales",
        data: [31, 40, 28, 51, 42, 109, 100],
      },
    ],
  },
  {
    title: "Customer",
    color: {
      backGround: "rgb(31, 29, 43)",
    },
    barValue: 80,
    value: "270",
    png: UilUserSquare,
    series: [
      {
        name: "Customer",
        data: [10, 100, 50, 70, 80, 30, 40],
      },
    ],
  },
  {
    title: "Rating",
    color: {
      backGround: "rgb(31, 29, 43)",
    },
    barValue: 78,
    value: "8.9",
    png: UilCommentAltHeart,
    series: [
      {
        name: "Expenses",
        data: [10, 25, 15, 30, 12, 15, 20],
      },
    ],
  },
];
